import styles from './Table.module.scss'
import clsx from 'clsx';
import { Link } from 'react-router-dom';
import { Navigate } from 'react-router-dom';
import { getAllTables } from '../../redux/store'
import { useSelector } from 'react-redux';



const Table = (props) => {
  const tables = useSelector(state => getAllTables(state));


  if (!tables)
    return <Navigate to="/" />
  else
    return (
      <div className="container">

        <li className={styles.table}>
          <div className="row justify-contetnt-between align-items-center">
            <h2 className="col-2 m-4">Table {props.id} </h2>
            <p className="col-2 m-5"><span className={styles.status}>Status:</span> {props.status} </p>
            <div className={clsx("col-6", styles.buttoncon)}><Link to={'/table/' + props.tableId} ><button className={clsx("btn-default, btn-lg", styles.btnshow)}>Show more</button></Link></div>

          </div>
        </li>

      </div>
    );
}

export default Table;
